(function ($) {

  var screenX = $(window).width();
  var tabletWidth = 991;
  var mobileWidth = 575;

  // parallax
  $.stellar({
    horizontalScrolling: false,
    horizontalOffset: 0,
    scrollProperty: 'scroll',
    parallaxBackgrounds: true
  });

  // col same height
  function col_equalizer() {
    $(".equalizer").each(function () {
      var heights = $(this).find(".col").map(function () {
          return $(this).height();
        }).get(),

        maxHeight = Math.max.apply(null, heights);

      $(".col").height(maxHeight);

      $(".col").find('.body').css('height', 'calc(100% - 244px)');

    });
  }

  $(document).ready(function () {

    $(".mobile_menu a, #block-tso-main-menu .navbar-nav a").click(function (e) {
      if ($(this).attr('href') === '#block-storeblock') {
        e.preventDefault();
        var aid = $(this).attr("href");
        $('#sm_menu_ham').removeClass('open');
        $('.sm_menu_outer').removeClass('active');
        $('html,body').animate({scrollTop: $(aid).offset().top}, 'slow');
      }
    });

    // console.log($('.groupage .groupage--info p').text().length);
    if ($('.groupage .groupage--info p').text().length > 220) {
      $('.groupage .groupage--info p').text($('.groupage .groupage--info p').text().substring(0, 220) + "...");
    }

    // menu mobile
    $(".container-mobile_menu").slideMobileMenu({
      // Hamburger Id
      "hamburgerId": "sm_menu_ham",
      // Menu Wrapper Class
      "wrapperClass": "sm_menu_outer",
      // Submenu Class
      "submenuClass": "submenu",
      // Calls when menu loaded
      "onMenuLoad": function () {
        return true;
      },
      // Calls when menu open/close
      "onMenuToggle": function () {
        return true;
      }
    });

    $(".hamburger").click(function () {
      $(this).toggleClass("is-active");
    });

    $(".mobile_menu a").click(function () {
      var menuHeight = $('.sm_menu_outer .mobile_menu .active .active .submenu').height();
      var deviceHeight = $(window).height();
      //console.log(menuHeight);
      $(this).parents('.mobile_menu').css('overflow-y', 'hidden');
      if (menuHeight > deviceHeight) {
        $(this).parents('.mobile_menu').css('overflow-y', 'scroll');
      }
      else if (typeof menuHeight === "undefined") {
        $(this).parents('.mobile_menu').css('overflow-y', 'hidden');
      }
      else if (menuHeight < deviceHeight) {
        $(this).parents('.mobile_menu').css('overflow-y', 'hidden');
      }
    });

    $(".sm_menu_outer .header-mobile_menu li.back a .fa").click(function () {
      $('.mobile_menu').css('overflow-y', 'hidden');
    });

    /*open menu */
    var navLink = $(".navbar-nav .menu-item .nav-link");

    navLink.each(function () {
      var target = $(this).data('target');
      if (target === 'prodotti' || target === 'products' || target === 'produkte') {
        $(this).mouseover(function () {
          //var target = $(this).data('target');
          $(this).addClass('hover');
          // console.log($(this).data('target'));
          $('#prodotti').css('display', 'table');
        })
          .mouseout(function () {
            var target = $(this).data('target');
            $(this).removeClass('hover');

            $('#prodotti').css('display', 'none');
          });
      }


    });


    $('[data-target~="prodotti"]').bind('click mousedown dblclick', function (e) {
      e.preventDefault();
      e.stopImmediatePropagation();
    });
    $('[data-target~="products"]').bind('click mousedown dblclick', function (e) {
      e.preventDefault();
      e.stopImmediatePropagation();
    });

    /*hover blog */
    var gridItem = $(".grid .grid-item");

    gridItem.each(function () {
      $(this).mouseover(function () {
        $(this).addClass('hover');
      })
        .mouseout(function () {
          $(this).removeClass('hover');

        });
    });

    /*hover listato */
    var listPdt = $(".pdt-strip .row > div");

    listPdt.each(function () {
      $(this).mouseover(function () {
        $(this).addClass('hover');
      })
        .mouseout(function () {
          $(this).removeClass('hover');

        });
    });

    // OwlCarousel
    $(".owl-fragranze").owlCarousel({

      responsive: {
        0: {
          loop: $(".owl-fragranze .item").length <= 1 ? false : true,
          items: 1,
          dots: true,
          margin: 0
        },
        768: {
          loop: $(".owl-fragranze .item").length <= 2 ? false : true,
          items: 2,
          dots: false,
          margin: 30,
          nav: true
        }
      },
      navText: ["", ""]

    });

    $(".owl-fullImg").owlCarousel({
      responsive: {
        0: {
          loop: $(".owl-fullImg .item").length <= 1 ? false : true,
          items: 1,
          dots: true,
          nav: false
        },
        576: {
          loop: $(".owl-fullImg .item").length <= 1 ? false : true,
          items: 1,
          dots: false,
          nav: true
        }
      },
      navText: ["", ""]
    });

    $(".owl-linea").owlCarousel({
      margin: 50,
      responsive: {
        0: {
          loop: $(".owl-linea .item").length <= 1 ? false : true,
          items: 1,
          nav: false,
          slideBy: 1
        },
        576: {
          loop: $(".owl-linea .item").length <= 2 ? false : true,
          items: 2,
          nav: false,
          slideBy: 2
        },
        768: {
          loop: $(".owl-linea .item").length <= 3 ? false : true,
          items: 3,
          nav: true,
          slideBy: 3
        }
      },
      navText: ["", ""]
    });

    $("#block-storeblock ul").owlCarousel({
      nav: false,
      responsive: {
        0: {
          dots: true,
          items: 1,
          slideBy: 1,
          loop: true
        },
        768: {
          dots: false,
          items: 9,
          loop: false
        }
      }
    });


    $(".owl-regali").owlCarousel({
      nav: true,
      items: 1,
      dots: false,
      margin: 0,
      autoHeight: true,
      navText: ["", ""]

    });

    // scrool down arrow
    $(".video .down-arrow").on('click', function () {
      var heightVideo = $('#block-videohp').height();
      $("html, body").animate({scrollTop: heightVideo}, 800);
    });

    if (screenX <= 767) {
      $(".owl-mag").owlCarousel({
        stagePadding: 45,
        slideBy: 1,
        items: 1,
        dots: false,
        responsive: {
          0: {
            margin: 16
          },
          576: {
            margin: 40
          }
        }
      });
    }

    if (screenX < mobileWidth) {
      $('.list-pdt .pdt-strip').last().find('.col-sm-4').last().find('.list-pdt--info').addClass('last');
    }

    if (screenX <= 992) {
      // change color header
      $(window).scroll(function () {
        var scroll = $(window).scrollTop();
        if (scroll > 40) {
          $('header').addClass('white-header');
          $('#sm_menu_ham').addClass('color-ham');
        }
        else {
          $('header').removeClass('white-header');
          $('#sm_menu_ham').removeClass('color-ham');
        }
      });
    }

    // newsletter validate
    $('#newsletterModal').on('shown.bs.modal', function () {
      $('#newsletter-form').validate({
        rules: {
          name: "required",
          lastname: "required",
          email: "required",
          check: "required"
        },
        messages: {
          name: Drupal.t("Campo obbligatorio"),
          lastname: Drupal.t("Campo obbligatorio"),
          email: {
            required: Drupal.t("Campo obbligatorio"),
            email: Drupal.t("Inserire un indirizzo email valido")
          },
          check: Drupal.t("Campo obbligatorio")
        }
      });
    });

    // contatti validate
    $('#contact-message-contatti-form').validate({
      rules: {
        'field_e_mail_confirm[0][value]': {
          equalTo: "#edit-field-e-mail-0-value"
        },
        'field_privacy[1]': "required"
      },
      messages: {
        'field_nome[0][value]': Drupal.t("Campo obbligatorio"),
        'field_cognome[0][value]': Drupal.t("Campo obbligatorio"),
        'field_nazione[0][value]': Drupal.t("Campo obbligatorio"),
        'field_citta[0][value]': Drupal.t("Campo obbligatorio"),
        'field_cap[0][value]': Drupal.t("Campo obbligatorio"),
        'field_telefono[0][value]': Drupal.t("Campo obbligatorio"),
        'subject[0][value]': Drupal.t("Campo obbligatorio"),
        'message[0][value]': Drupal.t("Campo obbligatorio"),
        'field_e_mail[0][value]': {
          required: Drupal.t("Campo obbligatorio"),
          email: Drupal.t("Inserire un indirizzo email valido")
        },
        'field_e_mail_confirm[0][value]': {
          required: Drupal.t("Campo obbligatorio"),
          // minlength: "Your password must be at least 5 characters long",
          email: Drupal.t("Inserire un indirizzo email valido"),
          equalTo: Drupal.t("Le mail inserite sono differenti")
        },
        'field_privacy[1]': Drupal.t("Campo obbligatorio")
      }
    });

    $('#newsletter-form').validate({
      messages: {
        'field_nome[0][value]': Drupal.t("Campo obbligatorio"),
        'field_cognome[0][value]': Drupal.t("Campo obbligatorio"),
        'lastname': Drupal.t("Campo obbligatorio"),
        'name': Drupal.t("Campo obbligatorio"),
        'email': Drupal.t("Campo obbligatorio"),
        'check': Drupal.t("Campo obbligatorio")
      }
    });


    $(window).on("resize", function () {

      var screenX = $(window).width();
      var img = new Image();
      if ($('.parallax').length > 0) {
        if (screenX < 1700) {
          img.src = $('.parallax').css('background-image').replace('url', '').replace('(', '').replace(')', '').replace('"', '').replace('"', ''); //get the background-image path
          $('.parallax').height(screenX / (img.width / img.height) - 100);
        }
        else {
          $('.parallax').height(700);
        }
      }

    }).resize();
  });

  $(window).on("load", function () {

    $('.modale-mappa').on('click', function (event) {
      event.preventDefault();
      jQuery.noConflict();
      $('#locationMap').modal('show');
    });

    if (screenX >= 768) {

      col_equalizer();
      var $grid = $('.grid').imagesLoaded(function () {
        $grid.masonry({
          // options
          itemSelector: '.grid-item',
          columnWidth: '.grid-sizer',
          gutter: '.gutter-sizer',
          percentPosition: true,
          // stamp elements
          stamp: '.stamp'
        });
      });

      $('.pdt-container .pdt .body').css('display', 'table');
    }
  });


})(jQuery);
;
